import "./Cemiyyet.scss";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import Section4 from "../components/Section4";
import Section5 from "../components/Section5";
import { NavLink, withRouter } from "react-router-dom";
import { connect } from "react-redux";
import React, { useState, useEffect } from "react";
import $ from "jquery";

function Cemiyyet({ text5 = [], displaymode1 }) {
  useEffect(() => {
    $(".navbar").css("position", displaymode1);
  });
  return (
    <>
      <Navbar />
      <div id="up" className="Cemiyyet">
        <div className="gif">
          <img
            className="img1"
            src="https://i.ibb.co/tPBnk9P/qafqaz.gif"
            alt=""
          />
        </div>
           <h1>Cəmiyyət</h1>
        <div className="sectionone">
          <div className="text">
            <div>
             Hacklab Cəmiyyət olaraq təkbaşınalıqdan çox, birlikdə düşünülən, analiz edilən, qərarlaşdırılan ideya və fikirləri dəstəkləyən bir cəmiyyətdir. Hacklab cəmiyyətinin maraqları “Sənaye 4.0” sahəsi ilə bağlıdır. Maraqlarımız ; Blokçeyn və Kripto (Blockchain & Crypto) , Böyük Həcmli Məlumat ( Big Data ) , Əşyaların İnterneti (IoT) ,  Laylı İstehsal (Additive Manufacturing) , Robototexnika (Robotics) sahələri üzrədir . 
            </div>
          </div>
          <img src="https://cdn.wallpapersafari.com/95/60/iQbLIK.jpg" />
        </div>
     
          
      </div>
      <Section5 />
      <Section4 />
      <Footer />
    </>
  );
}

const mapStateToProps = (state, ownProps) => {
  return {
    text5: state.text5,
    displaymode1: state.displaymode1
  };
};

export default connect(mapStateToProps)(Cemiyyet);
